// LandingPage.js
import React from 'react';
import './LandingPage.css';
import cheeseburgerImage from './images/cheese-burger.png'

const LandingPage = ({ goToMenu }) => {
  return (
    <div className="landing-page">

      <div className="landing-container">

        <div className="section-container">

          <div className="top-section-container">

            <div className="logo-circle-container">
              {/* <img src={cheeseburgerImage} alt="header-image" className="header-image"/> */}
            </div>

            <div className="content">
              <h4>THE 1O1 Bogor</h4>
              <p>We won multiple awards as a leading hotel with great food</p>
            </div>


          </div>

          <div className="mid-section-container">



          </div>

          <div className="bottom-section-container">
            <button onClick={goToMenu} className="dine-btn">
              Makan Di Tempat
            </button>
          </div> 

        </div>

      </div>

    </div>
  );
};

export default LandingPage;
